import React from 'react';
import '../styles/menu.css';
import menupic from'../assets/pexels-mister-mister-3490364.jpg';
function Menu() {
  return (
    <div>
        <main>
        <div className='title'>
        <div className='bgpic'>
          <img src={menupic} alt='img'></img>
        </div>
        </div>
        </main>
    </div>
  )
}

export default Menu
